import { HttpAuth } from '../../config/Http';

export const actionTypes = {
  USER_NAME: 'USER_NAME',
  USER_EMAIL: 'USER_EMAIL',
  USER_ID: 'USER_ID',
  USER_LOADING: 'USER_LOADING'
}

export const index = () => dispatch => {
  HttpAuth.get('/me')
    .then( (response) => {
      dispatch({
        type: 'INDEX_ME',
        payload: response.data
      })
      
    })
}
